text:
有一种执着，即便世界的改变也不会忘却，叫鸢一折纸；
有一种触动，即便再爱二次元也为情所动，叫本条二亚；
有一种悲愿，即便自己消失也要改变历史，叫时崎狂三；
有一种善良，即便自己痛苦也不伤害别人，叫四糸乃；
有一种职责，即便再重的担子也默默承受，叫五河琴里；
有一种孤独，即便封闭了内心也渴望关怀，叫星宫六喰；
有一种自卑，即便全世界反对也愿意抬头，叫七罪；
有一种姐妹，即便只能活一个也留给对方，叫八舞；
有一种信任，即便厌恶所有人也陪在身旁，叫诱宵美九；
有一种肯定，即便无数次反转也永不分离，叫夜刀神十香；
有一种真爱，即便注定被遗忘也矢志不渝，叫园神凛祢;
有一种女儿，即便会消失也要唤一声爸爸，叫园神凛绪;
有一种求知，即便明白爱你却也送你离开，叫或守鞠亚;
有一种悲伤，即便喜欢上你也要毁灭世界，叫或守鞠奈;
有一种存在，即便随即消逝也要向他告白，叫万由里;
有一种妹妹，即便失去记忆也一眼认出你，叫崇宫真娜;
有一种爱念，即便背叛世界也只愿你活着，叫崇宫澪;
有一种信仰，即便再过多少年也不会改变，叫DATE A LIVE！
